            console.log(`Notification job ${job.id} ${progress}% complete`);
        });

        //listen for job completion and failure
        job.on('complete', () => {
            console.log(`Notification job ${job.id} completed`);
        });

        job.on('failed', (err) => {
            console.log(`Notification job ${job.id} failed: ${err}`);
        });
    });
